import { Component } from "react";

const styles = {
    cartDetails: {
        backgroundColor: '#fff',
        position: 'absolute',
        marginTop: 30,
        boxShadow: '1px 5px 5px rgb(0, 0, 0, 0,3)',
        borderRadius: '5px',
        width: '300px',
    },
};

class CartDetails extends Component {
    render() {
        return (
            <div style={styles.cartDetails}>
                Cart Details
            </div>
        );
    }
}

export default CartDetails;
